import React from "react";
import Navbar from "../components/Navbar";
import img1 from "../assets/img-1.png";
import Section from '../components/homepage/Section';
const Products = () => {
  const products = [
    {
      image: img1,
      title: "Green Dress",
      price: 25.99,
      link: "/products/1",
    },
    {
      image: img1,
      title: "Green Dress",
      price: 25.99,
      link: "/products/1",
    },
    {
      image: img1,
      title: "Green Dress",
      price: 25.99,
      link: "/products/1",
    },
    {
      image: img1,
      title: "Green Dress",
      price: 25.99,
      link: "/products/1",
    },
    {
      image: img1,
      title: "Green Dress",
      price: 25.99,
      link: "/products/1",
    },
    {
      image: img1,
      title: "Green Dress",
      price: 25.99,
      link: "/products/1",
    },
    
  ];
  return (
    <>
      <Navbar />
      <Section array={products}/>
    </>
  );
};

export default Products;
